import "./app.css";
import Card from "./Card";
import { useState } from "react";

const App = () => {

  const names = [
    {
      name: "Peter",
      Age: 31,
      addrress: "Alexandria",
      Phone: "000000",
    },
    {
      name: "John",
      Age: 21,
      addrress: "Alexandria",
      Phone: "000002",
    },
    {
      name: "Lara",
      Age: 1,
      addrress: "Alexandria",
      Phone: "0000003",
    },
  ];
  return (
    <div>
      <Card names={names}></Card>
      <button type="button" class="btn btn-primary btn-floating">
      <i class="fas fa-trash-can"></i>
      </button>
    </div>
  )
};

export default App;
